function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 1:
        {
            v = (v > 4000 ? 4000 : (v < 40 ? 40 : v));
            return v;
        }
    case 2:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));

            {
                const oneStep = 1 / 1;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    case 3:
        {
            v = (v > 2 ? 2 : (v < 0 ? 0 : v));

            {
                const oneStep = 2 / 2;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    case 4:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));

            {
                const oneStep = 1 / 1;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    default:
        index -= 5;

        if (index < this.p_01[0].getNumParameters()) {
            {
                return this.p_01[0].constrainParameterValue(index, value);
            }
        }

        return value;
    }
}

